            WriteLiteral(@"<h3>NUESTRA INSTITUCIÓN</h3>
<div class=""row"">
  <div class=""col-lg-7"">
    <p>El Instituto de Investigación Nutricional (IIN) es una institución privada, sin fines de lucro, dedicada a la rehabilitación,investigación y docencia en las Áreas de Nutrición y Salud.</p>
    <p>En 1961 un grupo de pediatras peruanos bajo el liderazgo del Dr. George Graham, crearon un centro de investigación y rehabilitación de malnutrición severa infantil,dentro de la Clínica Anglo Americana que posteriormente llegára independizarse tomando el nombre de Instituto de Investigación Nutricional en el año de 1971 como un Organismo No Gubernamental. En 1982 el IIN establece su sede en el distrito de La Molina.</p>
    <p>En el transcurso de estos 40 años sigue su trabajo en la sede de La Molina el que se ha ido expandiendo a la comunidad, desarrollándose nuevas áreas de investigación e intervenciones para mejorar la nutrición y salud de la población peruana especialmente aquella de escasos recursos económicos; trabajando tanto en");
            WriteLiteral(@" la ciudad de Lima como en otras zonas del país.</p>
    <p>El IIN trabaja en coordinación con los Ministerios de Salud, de Desarrollo e Inclusión Social y de Agricultura, instituciones estatales, universidades nacionales e internacionales, organizaciones de la comunidad y privados.</p>
